import React from "react";

function Food({ props }) {
  return <h1>i like {props}</h1>;
}

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Food fav="kimchi" />
      <Food fav="ramen" />
    </div>
  );
}

export default App;
